import './App.css';

import { MailOutlined, SettingOutlined, FileTextOutlined, CalendarOutlined, FileAddOutlined } from '@ant-design/icons';
import Login from './components/login';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './views/home';
import Task from './components/task';
import Calend from './components/calendar';

// Define itemsList here
const itemsList = [
  {
    label: "Görevler",
    key: 'task',
    icon: <FileTextOutlined />,
    route: 'task',
  },
  {
    label: "Görev Ekle",
    key: 'task2',
    icon: <FileAddOutlined />,
    route: 'add-task',
  },
  {
    label: "Takvim",
    key: 'calendar',
    icon: <CalendarOutlined />,
    route: 'calendar',
  },
  {
    label: 'Mail',
    key: 'mail',
    icon: <MailOutlined />,
    route: 'mail',
  },
  {
    label: 'Profil Düzenle',
    key: 'setting:1',
    icon: <SettingOutlined />,
    route: 'edit-profile',
  }
];

function App() {
  return (

      <div className="App">
        {/* The Login component will always render as the default route */}
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/home" element={<Home itemsList={itemsList} />} />
          <Route path="/task" element={<Task/>} />
          <Route path="/add-task" element={<Task />} />
          <Route path="/calendar" element={<Calend />} />
          <Route path="/mail" element={<Task />} />
          <Route path="/edit-profile" element={<Task />} />
        </Routes>
      </div>

  );
}

export default App;
